import React from 'react'
import './App.css';
import moment from 'moment';


export default function FormButton({ Title, Data, Color}) {

  const TableContainer = {
    width: 180, 
    height: 250,
    alignItems: 'center',
    justifyContent: 'center',
    backgroundColor: 'rgba(52, 52, 52, 0)',
    borderRadius: 10,
    border: "3px solid #a93634",
    margin: 10,
  }

  const HeaderContainer = {
    backgroundColor: Color == undefined ? '#a93634' : Color,
    padding: 10,
    fontWeight: 'bold',
    fontSize: 16,
  }
  const BodyContainer = {
    padding: 3,
  }
  const TextContainer = {
    flexDirection: 'row',
  }
  const Text1 = {
    fontWeight: 'bold',
    fontSize: 12,
  }
  const Text2 = {
    fontSize: 10,
  }
  const Text3 = {
    fontSize: 10,
    color: Color == undefined ? '#a93634' : Color
  }

  return (

    <div style={TableContainer}>
        <div style={HeaderContainer}>
            {Title}
        </div>
        <div>

        <div style={BodyContainer}>
          {Data == undefined ? null : Data.map(element => {
                      return(
                            <li>
                                <span style={Text1}>
                                    {element.Product.name + ' | '}
                                </span>

                                <div style={TextContainer}>

                                    <span style={Text2}>
                                        {element.time}
                                    </span>

                                    <span style={Text3}>
                                        {element.time == element.rtTime ? ' +2' : ' +2'}
                                    </span>
                                </div>

                            </li>

                      )
                    })}
        </div>

        </div>
    </div>
  )
}
